import React, { useState, useEffect, useContext } from 'react';
import history from '../history';
import api from '../api';
import { TextField, Button } from "@material-ui/core";
import { Context } from '../Context/AuthContext';
import CssBaseline from '@material-ui/core/CssBaseline';
import Typography from '@material-ui/core/Typography';
import { makeStyles } from '@material-ui/core/styles';
import Container from '@material-ui/core/Container';
import Layout from './template/Layout'
import { SettingsRemoteOutlined } from '@material-ui/icons';

const useStyles = makeStyles((theme) => ({
  paper: {
    marginTop: theme.spacing(8),
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
  },
  avatar: {
    margin: theme.spacing(1),
    backgroundColor: theme.palette.secondary.main,
  },
  form: {
    width: '100%', // Fix IE 11 issue.
    marginTop: theme.spacing(1),
  },
  submit: {
    margin: theme.spacing(3, 0, 2),
  },
}));


export default function FormPaciente(dados) {
  const { handleLogout } = useContext(Context);
  const [paciente, setPaciente ] = useState();
  const [nome, setNome ] = useState();
  const [cpf, setCPF ] = useState();
  const [id, setID ] = useState();
  const classes = useStyles();

  useEffect(() => {
    (async () => {
      if (dados != ""){
        console.log("editando esse paciente")
        setNome(dados.location.state.nome);
        setCPF(dados.location.state.cpf);
        setID(dados.location.state.id);
      }
    })();
  }, []);



  return (
    <>
      <Layout />
      <Container component="main" maxWidth="xs">
        <CssBaseline />
        <div className={classes.paper}>
          <Typography component="h1" variant="h5">
            Cadastro Paciente!
          </Typography>
          <form 
            onSubmit={(event) => {
              event.preventDefault();
            }}
            className={classes.form} 
            noValidate
          >
            <TextField
              variant="outlined"
              margin="normal"
              defaultValue={ nome || ''}
              fullWidth
              id="nome"
              label="Nome Paciente"
              name="nome"
              onChange={(event) => {
                setNome(event.target.value);
              }}
            />
            <TextField
              variant="outlined"
              margin="normal"
              fullWidth
              defaultValue={ cpf || ''}
              name="cpf"
              label="CPF - Paciente"
              type="Text"
              id="cpf"
              onChange={(event) => {
                setCPF(event.target.value);
              }}
            />
            {id
              ? 
              <Button
                type="Submit"
                variant="contained"
                color="primary"
                className={classes.submit}
                onChange={(event) => {
                  alert("editando");
                }}
              >
                Editar
              </Button>
              : 
              <Button
                type="Submit"
                variant="contained"
                color="primary"
                className={classes.submit}
                onChange={(event) => {
                  alert("cadastrando");
                }}
              >
                Cadastrando
              </Button>
            }
           
          </form>
        </div>
      </Container>
    </>
  );
}
